import React, { SetStateAction} from "react";
import cn from "classnames";


interface Props {
    text: string,
    className : string,
    setType : React.Dispatch<SetStateAction<string>>,
    type : string
}
export default function HeadButton({text, className, setType, type} : Props){
    return (
        <button onClick={(event : React.MouseEvent<HTMLButtonElement>) => setType(type)} className={cn('base-button',className)}>{text}</button>
    )
}
